wave_r = .2 + .6 * sin (thump);
wave_b = .7 - .2 * sin (no_thump);
wave_g = .5 + .3 * sin (re_thump);

q1 = thump;
q2 = no_thump;
q3 = re_thump;
q4 = if(equal(q3,0), .05 * time, 1 * time);
q5 = vol;


wave_usedots = thump;
wave_thick = thump;
wave_additive = thump;
wave_brighten = thump;
